import React from "react";
import Header from "./Header";
import AkadOne from "./AkadOne";
import Footer from "./Footer";
import AkademiiCards from "./AkademiiCards";
const Akademii = () => {
  return (
    <div>
      <h1>akademii</h1>
      <Header />
      <AkadOne />
      <AkademiiCards />
      <Footer />
    </div>
  );
};

export default Akademii;
